int main()
{
	// Initialize Hardware
	CUBEMX_Init();
	// Initialize Leguan board
	LEGUAN_Init();
	// Initialize LCD
	LCD_Init();

	//--- Declarations
	uint32_t tick = 0;

	// Set logging output destination to be the LCD
	LOG_SetDestination(LCD_Stream);

	//--- Init functions
	LukiInit();

	//--- Main loop
	while (true)
	{
		if(HAL_GetTick() >= tick + 15)
		{
			//--- roundabout 60 fps
			tick = HAL_GetTick();

			//--- FPS anzeige
			//char *spast;
			//itoa(100, spast);


			LukisFunction();
		}
		//LukisFunction();
	}
}

void LukiInit(void)
{
	//LCD_SetForegroundColor(ColorWhite);
	//LCD_Rect(0, 0, 480, 480);

	//Draw Down Button
	LCD_SetForegroundColor(ColorRed);
	LCD_String(0, 0, "Hello");

	//color_t pixelColor;

	unsigned int i;

	//{B, G, R, T}
	//RGBA16_COLOR(r, g, b, a)

	for(unsigned int y = 0; y < tRexBmp.h; y++)
		{
			for(unsigned int x = 0; x < tRexBmp.w; x++)
			{
				i = y*tRexBmp.w + x;

				//if(tRex_pixelData[i][3] == 0)
					//continue;

				color_t pixelClr = COLOR(	tRex_pixelData[i][2],
											tRex_pixelData[i][1],
											tRex_pixelData[i][0],
											tRex_pixelData[i][3]);
				//if(pixelClr.a == 0)
					//continue;


				LCD_SetForegroundColor(pixelClr);
				LCD_Pixel(tRexBmp.x + x, tRexBmp.y + (tRexBmp.h - y));
			}
		}

	//Draw Up Button
}

void LukisFunction(void)
{
	static int x_old = 0;
	static int y_old = 0;

	LCD_TouchPosition_t touchPosition = {0, 0};
	if (R_SUCCESS(LCD_TouchGetPosition(&touchPosition)))
	{
		int x_new = touchPosition.x;
		int y_new = touchPosition.y;

		if (x_new != 0 || y_new != 480)
		{
			LCD_SetForegroundColor(ColorWhite);
			LCD_Rect(x_old - 5, y_old - 5, 30, 30);

			LCD_SetForegroundColor(ColorRed);
			LCD_Rect (x_new, y_new, 20, 20);

			x_old = x_new;
			y_old = y_new;
		}
	}
}
